import React, { Component } from 'react';
import './App.css';
import axios from 'axios'
import {Route,Link} from "react-router-dom"

const apiKey = process.env.REACT_APP_USDA_DATABASE_API_KEY;
const nutrients = "nutrient=2";
console.log(apiKey);
class App extends Component {
  constructor() {
    super()
    this.state = {
      nutrients: []
    }
    this.fetchData = this.fetchData.bind(this);
  }

  fetchData() {
    fetch(`https://api.nal.usda.gov/ndb/nutrients/?format=xml&api_key=t4EjXuXYGx0IYgHz044XnfwNjzS4S1FSHrNFW40E&nutrients=203&nutrients=204&nutrients=208&nutrients=205`)
      .then(response => response.json())
      .then(data => {
        console.log(data);
        this.setState({
          nutrients: data
        })
      })
      .catch(error => error.message);
  }


  render() {
    console.log(this.state.nutrients)
    return (
      <div className="App">
        <h1>Hello World</h1>
        <button onClick={this.fetchData()}>Press Me</button>
      </div>
    );
  }
}

export default App;
